[{'comment_id': 632020327, 'comment_body': 'This would be a lot easier to follow using a switch.  Not only that, but we want to avoid branching, and compilers often have an easier time optimizing a switch to do that.

```c
switch (imm8) {
  case 1:
    ...
    break;
  case 2:
    ...
    break;
}
```', 'comment_created': datetime.datetime(2021, 5, 13, 18, 36, 20, tzinfo=datetime.timezone.utc), 'commenter': 'nemequ', 'type': 'User'}]
